import './Header.css';
import { useState } from "react";
import MenuButton from '../Components/MenuButton';
import GlobalNav from '../Components/GlobalNav';

function Header({selectPage}) {
    const [showMenu, setShowMenu] = useState(false);
    return (
        <header className="header">
            <img src="http://placekitten.com/100/100?image=1" className="header__logo" alt="logo" />
            <h1 className="header__title">Home of Lovely Pets</h1>
            <div className="header_menu">
                <MenuButton showMenu={showMenu} setShowMenu={setShowMenu}></MenuButton>
            </div>
            <div className="header__nav">
                <GlobalNav selectPage={selectPage}></GlobalNav>
            </div>
        </header>
    )
}
export default Header
